INSERT INTO `tbl_scheme` (`id`, `schemeName`, `description`, `eligibility`, `applicationProcess`, `duration`) VALUES
(1, ' Pradhan Mantri Kisan Samman Nidhi (PM-KISAN)', '<p><strong>PM-KISAN</strong> is a central sector scheme launched on 24th February 2019 to supplement financial needs of land holding farmers, subject to exclusions. Under the scheme, financial benefit of Rs. 6000/- per year is transferred in three equal four-monthly installments into the bank accounts of farmers&rsquo; families across the country, through Direct Benefit Transfer (DBT) mode. Till now, Rs.</p>\r\n\r\n<p>2.81 lakh crores have been transferred through Direct Benefit Transfer (DBT) to more than 11 crores beneficiaries (Farmers) through various instalments.</p>\r\n', 'State Government and UT administration will identify the farmer families which are eligible for support as per scheme guidelines. The fund will be directly transferred to the bank accounts of the beneficiaries.', 'https://pmkisan.gov.in/', '2024'),
(2, ' Pradhan Mantri Kisan Samman Nidhi (PM-KISAN)', '<p>The Pradhan Mantri Kisan Samman Nidhi (PM-KISAN), a Central Sector Scheme,&nbsp;<strong>aims at providing financial assistance to all cultivable landholding farmer families across the country, subject to certain exclusion criteria</strong>. Under the Scheme, an amount of Rs. 6000/- is transferred annually in three equal installments of Rs.</p>\r\n', 'State Government and UT administration will identify the farmer families which are eligible for support as per scheme guidelines. The fund will be directly transferred to the bank accounts of the beneficiaries.', 'https://pmkisan.gov.in/', '2024');

