(1, 'Soil Testing and Management', 'Regularly test your soil to understand its composition and nutrient levels. Based on the results, apply appropriate fertilizers and organic amendments to maintain soil fertility.'),
(2, 'Crop Rotation', '<p>Rotate your crops annually to prevent soil depletion and reduce the risk of pest and disease buildup. Different crops have different nutrient needs and contribute different residues to the soil.</p>\r\n'),
(3, 'Water Management', '<p>Implement efficient irrigation techniques such as drip irrigation or sprinkler systems to conserve water and ensure proper hydration for your crops. Also, consider collecting rainwater for irrigation during dry periods.</p>\r\n'),
(4, 'Pest and Disease Control', '<p>Monitor your crops regularly for signs of pests and diseases. Employ integrated pest management (IPM) strategies, which include cultural, biological, and chemical control methods to minimize damage while reducing reliance on pesticides.</p>\r\n'),
(5, 'Weather Monitoring', '<p>Stay informed about weather forecasts and patterns to anticipate extreme conditions like droughts, floods, or frosts. Plan your planting, harvesting, and other agricultural activities accordingly.</p>\r\n'),
(6, 'Invest in Technology', '<p>Explore modern agricultural technologies such as precision farming, drones, and satellite imagery for better monitoring of crops, soil, and weather conditions. These tools can enhance efficiency and productivity on the farm.</p>\r\n'),
(7, 'Diversification', '<p>Consider diversifying your farm products to spread risk and capture various market opportunities. This could include growing different crops, raising multiple livestock species, or incorporating agroforestry practices.</p>\r\n'),
(8, 'Pradhan Mantri Kisan Samman Nidhi (PM-KISAN) scheme description', '<p>The Pradhan Mantri Kisan Samman Nidhi (PM-KISAN), a Central Sector Scheme,&nbsp;<strong>aims at providing financial assistance to all cultivable landholding farmer families across the country, subject to certain exclusion criteria</strong>. Under the Scheme, an amount of Rs. 6000/- is transferred annually in three equal installments of Rs</p>\r\n');

